import React from "react";
import Circle from "./Circle";

export interface BubblePhotoProps {
	image: string;
	size: string;
}

class BubblePhoto extends React.Component<BubblePhotoProps, {}> {
	render() {
		return (
			<div className="BubblePhoto">
				<Circle diameter={this.props.size} backgroundImage={`url(${this.props.image})`} />
				<Circle diameter={this.props.size} backgroundImage="linear-gradient(to top right, var(--primary-dark), var(--accent-dark) 80%, var(--accent-light))" />
			</div>
		);
	}
}

export default BubblePhoto;
